    })

    return (
      <tr>
        <th scope="row">{props.num}</th>
        <td>{props.data.company}</td>
        <td>
          {props.data.title}
          <a className="ml-3" href={props.data.link}>â‡±</a>
        </td>
        <td>{stackButtons.length > 0 ? stackButtons : "-"}</td>
      </tr>
    );
}

export default TableRow
